import * as o from "react";
import m from "../lib/SSRBase.es.js";
import t from "../defs/FramerLogo.es.js";
const r = o.forwardRef((e, a) => /* @__PURE__ */ o.createElement(m, { ref: a, ...e, weights: t }));
r.displayName = "FramerLogoIcon";
const f = r;
export {
  f as FramerLogo,
  r as FramerLogoIcon
};
